import React from 'react'
export default function BottomTabs() {
  return (
    <View style={{flexDirection : "row", 
            margin : 10,
            marginHorizontal : 30,
            justifyContent : "space-between",
    }}>
      <Text>Bottom Tabs</Text>
      <Text>Bottom Tabs</Text>
      <Text>Bottom Tabs</Text>
    </View>
  )
}
